class Footer extends Component {
    render() { 
        return (
        <div>
            <ul>
                <li>zuri.internship</li>
                <li>HNG internship 9 Frontend Task</li>
                <li>INGRESSIVE FO GOOD</li>
            </ul>
        </div>
        );
    }
}
 
export default Footer;
